  fb:m.02k54 fb:location.country.capital ?capital .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?coach ?coachLabel WHERE {
  fb:m.0jm3v fb:basketball.basketball_team.head_coach ?coach .
  OPTIONAL {
    ?coach rdfs:label ?coachLabel .
    FILTER ( LANG( ?coachLabel ) = 'en' )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?governor WHERE {
  fb:m.02xry fb:government.governmental_jurisdiction.governing_officials ?position .
  ?position fb:government.government_position_held.basic_title fb:m.0fkvn .
  ?position fb:government.government_position_held.office_holder ?governor .
  OPTIONAL {
    ?position fb:government.government_position_held.to ?to .
  }
  FILTER ( ! BOUND( ?to ) || STR( ?to ) > STR( NOW () ) )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?sport ?sportLabel WHERE {
  fb:m.02d9k fb:sports.pro_athlete.sports_played_professionally ?sport .
  OPTIONAL {
    ?sport rdfs:label ?sportLabel
  }
}
LIMIT 1

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?item ?name WHERE {
  fb:m.01vsgrn fb:base.schemastaging.context_name.official_name ?name .
  FILTER ( LANG( ?name ) = 'en' ) BIND( fb:m.01vsgrn AS ?item )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?language WHERE {
  fb:m.0jgd fb:location.country.languages_spoken ?language .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?zipCode WHERE {
  fb:m.0qskp fb:location.citytown.postal_codes ?zipCode .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?invention WHERE {
  fb:m.0h24w fb:law.inventor.inventions ?invention
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?senator ?fromDate ?toDate WHERE {
  FILTER ( ?senator != fb:m.04ly1 ) fb:m.04ly1 fb:government.political_district.representatives ?position .
  ?position fb:government.government_position_held.office_holder ?senator .
  ?position fb:government.government_position_held.office_position_or_title fb:m.02_7l8y .
  OPTIONAL {
    ?position fb:government.government_position_held.from_date ?fromDate
  }
  OPTIONAL {
    ?position fb:government.government_position_held.to_date ?toDate
  }
  FILTER ( ! BOUND( ?toDate ) || ?toDate > "2023-10-01" ^^ xsd:date )
}
ORDER BY DESC ( ?fromDate )
LIMIT 2

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?placeOfBirth WHERE {
  fb:m.047sxrj fb:people.person.place_of_birth ?placeOfBirth
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?notableType ?alias ?description WHERE {
  fb:m.0f4vbz fb:common.topic.notable_types ?notableType .
  OPTIONAL {
    fb:m.0f4vbz fb:common.topic.alias ?alias .
    FILTER ( LANG( ?alias ) = "en" )
  }
  OPTIONAL {
    fb:m.0f4vbz fb:common.topic.description ?description .
    FILTER ( LANG( ?description ) = "en" )
  }
}
LIMIT 1
